// src/components/Dashboard.jsx
import React, { useState } from 'react';
import TodoList from './TodoList';

const Dashboard = ({ courses }) => {
  return (
    <div>
      <h2>Dashboard</h2>
      {courses.map((course, index) => (
        <div key={index}>
          <h3>{course}</h3>
          <TodoList course={course} category="Assignments" />
          <TodoList course={course} category="Exams" />
          <TodoList course={course} category="Study Goals" />
        </div>
      ))}
    </div>
  );
};

export default Dashboard;
